import '../styles/Navbar.css'
import { Component } from 'react'
import Link from 'next/link'



class Navbar extends Component {
  constructor() {
    super()
  }

  render(h) {
    return (
      <div>
        <ul>
        <li>
            <Link href="/"> Main</Link>
          </li>
          <li>
            <Link href="/about"> About</Link>
          </li>
        </ul>

      </div>

    );
  }
}

export default Navbar;
